<?php
namespace DavidCanial\RemoteConfigTool;
use Google\Auth\ApplicationDefaultCredentials;
class FirebaseAuth
{
public static function f_0761bc9f64ec934dc2c728ec28da6cbb47050b6bebed17917191e3fa2b3a6fc17eb06bbcc239aaccf652dc8881ae7807b94028b7a47f8d9122f9025fa031b217(): string
{
$v_ = ["https://www.googleapis.com/auth/firebase.remoteconfig"];
$v_ = ApplicationDefaultCredentials::getCredentials($v_);
$v_ = $v_->fetchAuthToken();
if (empty($v_["access_token"])) {
throw new \RuntimeException("Google のアクセストークンを取得できませんでした。");
}
return $v_["access_token"];
}
}
